import React, { Component } from 'react';
import {Datatable} from "@o2xp/react-datatable";
import axios from 'axios';
import DatePicker from 'react-date-picker';

let options  = {
    keyColumn: 'id',
    data: {
        columns: [ 
            {
                id: "id",
                label: "id",
                colSize: "80px"
            },
            {
                id: "name",
                label: "name",
                colSize: "150px"
            },
            {
                id: "age",
                label: "age",
                colSize: "50px"
            },
        ],
        rows: [
            {
                id: "50cf",
                age: 28,
                name: "Kerr Mayo"
            },
            {
                id: "209",
                age: 34,
                name: "Freda Bowman"
            },
            {
                id: "2dd81ef",
                age: 14,
                name: "Becky Lawrence"
            }
        ],
    }
}


export default class medicineList extends Component {
    
    constructor(props) {
        super(props);

        this.state = {

        }
        
    }
    


    render() {


        return (
            <div style={{marginTop: 10}}>
                <h3>Medicine List</h3>
                
                <Datatable options={options} />;


            </div>
        )
    }
}
